import React, { Component } from "react";
import "./node.css";

class Node extends Component {
  state = {};
  render() {
    if (this.props.nodeType === "start") {
      return <div className="start-node"></div>;
    } else if (this.props.nodeType === "end") {
      return <div className="end_node"></div>;
    } else {
      return <div className="node"></div>;
    }
  }
}

export default Node;
